import React, { useState, useEffect } from 'react';
import { getData, searchData, filterData, getStatisticsData } from './apiService';

const DataTable = () => {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [stateFilter, setStateFilter] = useState('');
  const [firstNameSearch, setFirstNameSearch] = useState('');
  const [statistics, setStatistics] = useState(null);

  // Fetch all data
  const fetchData = async () => {
    try {
      const result = await getData();
      setData(result);
      setStatistics(null); // Clear statistics when fetching data
    } catch (error) {
      setError('Failed to load data');
    } finally {
      setLoading(false);
    }
  };

  // Fetch search data
  const searchDataByFirstName = async (firstName) => {
    try {
      setStatistics(null); // Clear statistics
      setData([]); // Clear data before loading new data
      const result = await searchData(firstName);
      setData(result);
    } catch (error) {
      setError('Failed to search data');
    }
  };

  // Fetch filtered data by state
  const filterDataByState = async (state) => {
    try {
      setStatistics(null); // Clear statistics
      setData([]); // Clear data before loading new data
      const result = await filterData(state);
      setData(result);
    } catch (error) {
      setError('Failed to filter data');
    }
  };

  // Fetch statistics
  const fetchStatistics = async () => {
    try {
      setData([]); // Clear data when fetching statistics
      const result = await getStatisticsData();
      setStatistics(result);
    } catch (error) {
      setError('Failed to load statistics');
    }
  };

  // Effect for loading data initially
  useEffect(() => {
    fetchData();
  }, []);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div>
      <h2>Data Table</h2>

      {/* Search */}
      <input
        type="text"
        placeholder="Search by First Name"
        value={firstNameSearch}
        onChange={(e) => setFirstNameSearch(e.target.value)}
      />
      <button onClick={() => searchDataByFirstName(firstNameSearch)}>Search</button>

      {/* Filter by state */}
      <input
        type="text"
        placeholder="Filter by State"
        value={stateFilter}
        onChange={(e) => setStateFilter(e.target.value)}
      />
      <button onClick={() => filterDataByState(stateFilter)}>Filter</button>

      {/* Show Statistics */}
      <button onClick={fetchStatistics}>Show Statistics</button>

      {/* Display statistics */}
      {statistics && (
        <div>
          <h3>Statistics</h3>
          <ul>
            {statistics.map((stat) => (
              <li key={stat.state}>
                <strong>{stat.state}</strong> - Avg Age: {stat.averageAge}, Most Common First Name: {stat.mostCommonFirstName}, Most Common Last Name: {stat.mostCommonLastName}
              </li>
            ))}
          </ul>
        </div>
      )}

      {/* Data Table */}
      {data.length > 0 && (
        <table>
          <thead>
            <tr>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Age</th>
              <th>Street</th>
              <th>City</th>
              <th>State</th>
              <th>Latitude</th>
              <th>Longitude</th>
              <th>Credit Card</th>
            </tr>
          </thead>
          <tbody>
            {data.map((item) => (
              <tr key={item.seq}>
                <td>{item.nameFirst}</td>
                <td>{item.nameLast}</td>
                <td>{item.age}</td>
                <td>{item.street}</td>
                <td>{item.city}</td>
                <td>{item.state}</td>
                <td>{item.latitude}</td>
                <td>{item.longitude}</td>
                <td>{item.ccNumber}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default DataTable;
